import React, { useCallback, useEffect } from "react";
import { useParams } from "react-router-dom";
import classes from "./EventDetail.module.css";
import { findEvent } from "../store/eventReducer";
import { useDispatch, useSelector } from "react-redux";

const EventDetail = () => {
  const params = useParams();

  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(findEvent({ id: params.eventId }));
  }, []);

  const data = useSelector((state) => state.dummyData.findedData);

  console.log(data);

  return (
    <React.Fragment>
      <div className={classes.card}>
        <h2>
          {data.length !== 0 && data[0].title} (
          {data.length !== 0 && data[0].date})
        </h2>
        <img src={data.length !== 0 && data[0].url} alt="meteor" />
        <p>{data.length !== 0 && data[0].description}</p>
      </div>
    </React.Fragment>
  );
};

export default EventDetail;

